import './App.css';
import React from 'react';
import { library } from '@fortawesome/fontawesome-svg-core'
import { fas } from '@fortawesome/free-solid-svg-icons'
import { faTwitter, faFontAwesome } from '@fortawesome/free-brands-svg-icons'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import './LogIn.js';

library.add(fas, faTwitter, faFontAwesome)

function User(props) {
  return (
    <div>
      <button type="button" className="btn btn-outline-primary rounded-5">
        <FontAwesomeIcon icon="fa-solid fa-user" />
      </button>
    </div>
  );
}

class Search extends React.Component {
  constructor(props) {
    super(props);
    this.state = {click: false}
    this.click = this.click.bind(this);
  }
  click() {
    this.setState({
      click: true
    })
  }
  render() {
    if(!this.state.click){
      return (
        <div >
          <button onClick={this.click} type="button" className="btn btn-outline-primary rounded-5">
            <FontAwesomeIcon icon="fa-solid fa-magnifying-glass" />
          </button>
        </div>
      );
    }
    return (
      <div > 
        <input className="form-control rounded-5" type="text" placeholder="Place" aria-label="default input example"></input>   
      </div>
    );
  }
}

class HomePage extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div id="homepage" className='conteiner-fluid d-flex flex-column  align-items-center justify-content-between'>
        <div />
        <Search />
        <User />
      </div>
    );
  }
}

function App() {
  return (
    <div className="App">
      <HomePage />
    </div>
  );
}

export default App;
